import { Link, Route, Routes } from "react-router-dom";
import Dosa from "./Dosa";
import Idly from "./Idly";
import Curdrice from "./Curdrice";
import Briyani from "./Briyani";
import Vadai from "./Vadai";
import Uttapam from "./Uttapam";

export default function Home() {
  return (
    <div className="px-32">
        <div className="bg-red-50 rounded-lg">
  <p className="py-10 px-10 font-serif text-xl">Recipe your would like to explore...!</p></div>
    <div className="container mx-auto py-8">
        <div className="grid grid-cols-3 gap-10">
            <div className="relative rounded-lg overflow-hidden shadow-md transition duration-300 transform hover:shadow-xl">
                <img src="data:image/jpeg;base64," alt="dosa" className="w-full h-auto rounded-t-lg"/>
                <h1>Dosa</h1>
                <div className="absolute inset-0 flex items-center justify-center opacity-0 transition-opacity duration-300 bg-black bg-opacity-50 hover:opacity-100">
                    <button className="px-6 py-3 text-white bg-gray-500 rounded-md hover:bg-green-700" ><Link to={'/dosa'}>View</Link></button>
                </div>
            </div>
            <div className="relative rounded-lg overflow-hidden shadow-md transition duration-300 transform hover:shadow-xl">
                <img src="data:image/jpeg;base64," alt="idly" className="w-full h-auto rounded-t-lg"/>
                <h1>Idly</h1>
                <div className="absolute inset-0 flex items-center justify-center opacity-0 transition-opacity duration-300 bg-black bg-opacity-50 hover:opacity-100">
                    <button className="px-6 py-3 text-white bg-gray-500 rounded-md hover:bg-green-700"><Link to={'/idly'}>View</Link></button>
                </div>
            </div>
            <div className="relative rounded-lg overflow-hidden shadow-md transition duration-300 transform hover:shadow-xl">
                <img src="data:image/jpeg;base64," alt="rice" className="w-full h-auto rounded-t-lg"/>
                <h1>Curd rice</h1>
                <div className="absolute inset-0 flex items-center justify-center opacity-0 transition-opacity duration-300 bg-black bg-opacity-50 hover:opacity-100">
                    <button className="px-6 py-3 text-white bg-gray-800 rounded-md hover:bg-green-700"><Link to={'/curdrice'}>View</Link></button>
                </div>
            </div>
            <div className="relative rounded-lg overflow-hidden shadow-md transition duration-300 transform hover:shadow-xl">
                <img src="data:image/jpeg;base64," alt="briyani" className="w-full h-auto rounded-t-lg"/>
                <h1>Biriyani</h1>
                <div className="absolute inset-0 flex items-center justify-center opacity-0 transition-opacity duration-300 bg-black bg-opacity-50 hover:opacity-100">
                    <button className="px-6 py-3 text-white bg-gray-800 rounded-md hover:bg-green-700"><Link to={'/briyani'}>View</Link></button>
                    
                </div>
            </div>
            <div className="relative rounded-lg overflow-hidden shadow-md transition duration-300 transform hover:shadow-xl">
                <img src="data:image/jpeg;base64," alt="vadai" className="w-full h-auto rounded-t-lg"/>
                <h1>Vadai</h1>
                <div className="absolute inset-0 flex items-center justify-center opacity-0 transition-opacity duration-300 bg-black bg-opacity-50 hover:opacity-100">
                    <button className="px-6 py-3 text-white bg-gray-800 rounded-md hover:bg-green-700"><Link to={'/vadai'}>View</Link></button>
                </div>
            </div>
            <div className="relative rounded-lg overflow-hidden shadow-md transition duration-300 transform hover:shadow-xl">
                <img src="data:image/jpeg;base64," alt="Place 6" className="w-full h-auto rounded-t-lg"/>
                <h1>Uttapam</h1>
                <div className="absolute inset-0 flex items-center justify-center opacity-0 transition-opacity duration-300 bg-black bg-opacity-50 hover:opacity-100">
                    <button className="px-6 py-3 text-white bg-gray-800 rounded-md hover:bg-green-700"><Link to={'/uttapam'}>View</Link></button>
                </div>
            </div>
        </div>
    </div>
    <Routes >
        <Route path='/dosa' element={<Dosa />} />
      <Route path='/idly' element={<Idly  />}/> 
      <Route path='/curdrice' element={<Curdrice  />}/>
      <Route path='/briyani' element={<Briyani  />}/> 
      <Route path='/vadai' element={<Vadai  />}/>  
      <Route path='/uttapam' element={<Uttapam  />}/> 
    </Routes>
    </div>
  )
}
